class Animals:
    def __init__(self):
        self.data = [*cat, *dog, *rabbit, *bear, *dolphin, *bird, *frog, *deer, *monkey, *masupial, *wolve, *camel, *horse]

    def random(self):
        r = [int(str(int(time.time()))[-2:]), int(str(time.time())[-2:]), int(datetime.now().hour), int(datetime.now().minute)]
        return sum(r) % len(self.data)

    def pick_one(self):
        r = self.random()
        return self.data[r]


class Cats(Animals):
    def __init__(self):
        self.data = cat


